  [],\n\t\"revision_timestamp\": \"2015-05-07T06:01:06.156180\",\n\t\"name\": \"wireless-health-monitoring-for-large-arrays-of-mems-sensors-and-actuators-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The objective of this Phase I project is
  to demonstrate an automated on-line structural health monitoring system for aircraft
  structures using a combination of wireless data acquisition and fault detection
  filter via a sensing network for vehicle-embedded large arrays of MEMS sensors and
  actuators. A fault detection filter, whose functions are to identify and localize
  the damage, is considered as a new concept in the field of structural health monitoring.
  Sensor validation is implemented in the distributed sensor network to ensure only
  validated data are sent to the central station for further system utilization. Wireless
  communication provides a safe, affordable, and more efficient method for the online
  health monitoring of vehicle subsystems and information monitoring.  It also involves
  signal processing to support decision-making related to safety, maintenance, or
  operating procedures.  rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
